import React, { useContext, useState } from 'react';
import { GlobalContext } from '../../context/GlobalState';
import Navbar from '../../components/Navbar/Navbar';
import { Container } from '@material-ui/core';
import useForm from '../../customHooks/useForm';

const Form = () => {
  const { viaCep } = useContext(GlobalContext);
  const [userCep, setUserCep] = useState<ViaCep | null>(viaCep);
  if (!viaCep) {
    throw new Error("Cep não encontrado.");
  }
  const {
    values,
    errors,
    touched,
    handleChange,
    handleBlur,
    handleSubmit,
  } = useForm();

  const handleFormSubmit = (e) => {
    e.preventDefault();

    const formErrors = {};
    if (values.name.trim() === '') {
      formErrors.name = 'O nome é obrigatório';
    }
    if (values.cpf.trim() === '') {
      formErrors.cpf = 'O cpf é obrigatório';
    }
    if (values.email.trim() === '') {
      formErrors.email = 'O email é obrigatório';
    }
    if (values.neighborhood.trim() === '') {
      formErrors.neighborhood = 'O bairro é obrigatório';
    }
    if (values.cep.trim() === '') {
      formErrors.cep = 'O cep é obrigatório';
    }
    if (values.city.trim() === '') {
      formErrors.city = 'A cidade é obrigatória';
    }
    if (values.street.trim() === '') {
      formErrors.street = 'A rua é obrigatória';
    }
    if (values.state.trim() === '') {
      formErrors.state = 'O estado é obrigatório';
    }
    if (values.number.trim() === '') {
      formErrors.number = 'O número é obrigatório';
    }

    if (Object.keys(formErrors).length === 0) {
      // Simulação de envio do formulário
      // Aqui você pode substituir pelo código de envio para a API

      // Mostrar mensagem de sucesso
      alert(`Foi enviado uma mensagem para o email cadastrado ${values.email} com as informações para dar prosseguimento ao cadastro.`);

      // Limpar os valores do formulário
      handleChange({ target: { name: 'name', value: '' } });
      handleChange({ target: { name: 'cpf', value: '' } });
      handleChange({ target: { name: 'email', value: '' } });
      handleChange({ target: { name: 'neighborhood', value: '' } });
      handleChange({ target: { name: 'cep', value: '' } });
      handleChange({ target: { name: 'city', value: '' } });
      handleChange({ target: { name: 'street', value: '' } });
      handleChange({ target: { name: 'complement', value: '' } });
      handleChange({ target: { name: 'state', value: '' } });
      handleChange({ target: { name: 'number', value: '' } });
    } else {
      // Mostrar mensagem de erro
      alert('Não foi possível realizar o cadastro. Reveja as informações e tente novamente.');
    }

    // Registro dos dados no console
    console.log('Valores do formulário:', values);
    console.log('Erros:', formErrors);
  };

  return (
    <Container>
      <Navbar />
      <form onSubmit={handleFormSubmit}>
        <input
          name="name"
          placeholder="Nome Completo"
          value={values.name || ''}
          required
          maxLength={130}
          onChange={handleChange}
          onBlur={handleBlur}
        />
        {touched.name && errors.name && <div className="error">{errors.name}</div>}

        <input
          name="cpf"
          required
          maxLength={11}
          pattern="[0-9]{11}"
          placeholder="Cpf, deve conter apenas números"
          value={values.cpf || ''}
          onChange={handleChange}
          onBlur={handleBlur}
        />
        {touched.cpf && errors.cpf && <div className="error">{errors.cpf}</div>}

        <input
          name="email"
          placeholder="Email"
          required
          pattern="[a-zA-Z0-9._-]{1,64}@[a-zA-Z0-9.-]{1,}\.[a-zA-Z]{2,}"
          value={values.email || ''}
          onChange={handleChange}
          onBlur={handleBlur}
        />
        {touched.email && errors.email && <div className="error">{errors.email}</div>}

        <input
          name="cep"
          placeholder="Cep"
          pattern="[0-9]{5}-[0-9]{3}"
          required
          value={values.cep || userCep?.cep}
          onChange={handleChange}
          onBlur={handleBlur}
        />
        {touched.cep && errors.cep && <div className="error">{errors.cep}</div>}

                <input
                    name="neighborhood"
                    placeholder="Bairro"
                    required
                    value={values.neighborhood || userCep?.bairro}
                    onChange={handleChange}
                    onBlur={handleBlur}/>

                <input
                    name="city"
                    placeholder="Cidade"
                    required
                    value={values.city || userCep?.localidade}
                    onChange={handleChange}
                    onBlur={handleBlur}/>

                <input
                    name="street"
                    placeholder="Rua"
                    required
                    value={values.street || userCep?.logradouro}
                    onChange={handleChange}
                    onBlur={handleBlur}/>

                <input
                    name="complement"
                    placeholder="Complemento"
                    value={values.complement || ''}
                    onChange={handleChange}
                    onBlur={handleBlur}/>

                <input
                    name="state"
                    placeholder="Estado"
                    required
                    value={values.state || userCep?.uf}
                    onChange={handleChange}
                    onBlur={handleBlur}/>
                <input
                    name="number"
                    placeholder="Número"
                    required
                    value={values.number || ''}
                    onChange={handleChange}
                    onBlur={handleBlur}/>
                <button>Enviar Cadastro</button>
            </form>
        </Container>
    );
};

export default Form;
